(8736, 1227, '_form', '<div class="row onscroll-animate" data-animate="fadeInUp">\n<div class="col-xs-12 col-sm-6 col-md-6 col-lg-6">[email email placeholder "Enter Street Address"]</div>\n<div class="col-xs-12 col-sm-6 col-md-6 col-lg-6">[text room placeholder "Apartment, Suite or Room"]</div>\n</div>\n<div class="row onscroll-animate" data-animate="fadeInUp">\n<div class="col-xs-12 col-sm-6 col-md-6 col-lg-6">[text city placeholder "City"]</div>\n<div class="col-xs-12 col-sm-6 col-md-6 col-lg-6">\n<div class="col-xs-5 col-sm-5 col-md-5 col-lg-5">[text zip placeholder "Zip Code"]</div>\n</div>\n</div>\n</div>\n<div class="margin-30"></div>\n<div class="onscroll-animate text-center" data-animation="flipInY">\n[submit class:button-yellow class:button-long class:no-margin class:with-right-arrow class:form-submit-trigger class:onscroll-animate "MAKE YOUR ORDER" ][/submit]</div>'),
