(399, 1, '2015-10-05 10:25:42', '2015-10-05 10:25:42', 'In the English boats two tubs are used instead of one; the same line being continuously coiled in both tubs. There is some advantage in this; because these twin-tubs being so small they fit more readily into the boat, and do not strain it so much; whereas, the American tub, nearly three feet in diameter and of proportionate depth, makes a rather bulky freight for a craft whose planks are but one half-inch in thickness; for the bottom of the whale-boat is like critical ice, which will bear up a considerable distributed weight, but not very much of a concentrated one. When the painted canvas cover is clapped on the American line-tub, the boat looks as if it were pulling off with a prodigious great wedding-cake to present to the whales.\n\nBefore lowering the boat for the chase, the upper end of the line is taken aft from the tub, and passing round the loggerhead there, is again carried forward the entire length of the boat, resting crosswise upon the loom or handle of every man''s oar, so that it jogs against his wrist in rowing; and also passing between the men, as they alternately sit at the opposite gunwales, to the leaded chocks or grooves in the extreme pointed prow of the boat, where a wooden pin or skewer the size of a common quill.', 'How to get the best time with your Family', '', 'publish', 'open', 'open', '', 'how-to-get-the-best-time-with-your-family', '', '', '2015-10-05 10:25:42', '2015-10-05 10:25:42', '', 0, 'http://demo.cmssuperheroes.com/themeforest/wp-pizzeria/?p=399', 0, 'post', '', 0),
