(1094, 1, '2016-03-04 05:06:27', '2016-03-04 05:06:27', '[vc_row css=".vc_custom_1444033026454{margin-bottom: 0px !important;}"][vc_column offset="vc_col-lg-6 vc_col-md-6"][vc_custom_heading text="Our History" font_container="tag:h2|text_align:left|color:%23ffffff" use_theme_fonts="yes" css=".vc_custom_1444030946348{margin-bottom: 27px !important;}"][vc_column_text css=".vc_custom_1444031035704{margin-bottom: 10px !important;}"]It may be that the primal source of all those pictorial delusions will be found among the oldest Hindoo, Egyptian, and Grecian sculptures. For ever since those inventive but unscrupulous times when on the marble panellings of temples, the pedestals of statues, and on shields, medallions, cups, and coins, the dolphin was drawn in scales of chain-armor like Saladin''s, and a helmeted head like St. George''s; ever since then has something of the same sort of license prevailed, not only in most popular pictures of the whale, but in many scientific presentations of him.[/vc_column_text][/vc_column][vc_column offset="vc_col-lg-6 vc_col-md-6"][vc_video link="http://www.youtube.com/embed/rEk0AdJx9gw" css=".vc_custom_1444031096404{margin-top: 20px !important;}"][/vc_column][/vc_row][vc_row css=".vc_custom_1444033037753{margin-bottom: 0px !important;}"][vc_column][vc_single_image image="167" img_size="full" alignment="center" css=".vc_custom_1444031388386{margin-top: 60px !important;margin-bottom: 60px !important;}"][/vc_column][/vc_row][vc_row css=".vc_custom_1444033044489{margin-bottom: 0px !important;}"][vc_column offset="vc_col-lg-6 vc_col-md-6"][vc_gallery type="flexslider_slide" interval="3" images="848,851,861" img_size="570x334" onclick="" css=".vc_custom_1446004936381{margin-top: 0px !important;}"][/vc_column][vc_column offset="vc_col-lg-6 vc_col-md-6"][vc_custom_heading text="Amazing Interior" use_theme_fonts="yes" css=".vc_custom_1447381767253{margin-top: 21px !important;margin-bottom: 27px !important;}"][vc_column_text css=".vc_custom_1444031626946{margin-bottom: 10px !important;}"]It may be that the primal source of all those pictorial delusions will be found among the oldest Hindoo, Egyptian, and Grecian sculptures. For ever since those inventive but unscrupulous times when on the marble panellings of temples, the pedestals of statues, and on shields, medallions, cups, and coins, the dolphin was drawn in scales of chain-armor like Saladin''s, and a helmeted head like St. George''s; ever since then has something of the same sort of license prevailed, not only in most popular pictures of the whale, but in many scientific presentations of him.[/vc_column_text][/vc_column][/vc_row][vc_row full_width="stretch_row" overlay_row="yes" css=".vc_custom_1447382515209{margin-top: 45px !important;margin-bottom: 45px !important;padding-top: 50px !important;padding-bottom: 49px !important;background-image: url(http://demo.cmssuperheroes.com/themeforest/wp-pizzeria/wp-content/uploads/2015/09/bg3.png?id=32) !important;}" overlay_color="#ffffff" overlay_opacity="0.94" row_color_text="#000000"][vc_column offset="vc_col-lg-6 vc_col-md-6"][vc_single_image image="369" img_size="full"][/vc_column][vc_column offset="vc_col-lg-6 vc_col-md-6"][vc_custom_heading text="Now availaible for your smartphones" font_container="tag:h1|text_align:left|color:%23000000" use_theme_fonts="yes" css=".vc_custom_1444033556446{margin-bottom: 27px !important;}"][vc_column_text css=".vc_custom_1444034215806{margin-bottom: 20px !important;}"]It was under very similar circumstances to the first performance; but this time he did not breast out the line; and hence, when the whale started to run, Pip was left behind on the sea, like a hurried traveller''s trunk. Alas! Stubb was but too true to his word. It was a beautiful, bounteous, blue day[/vc_column_text][vc_raw_html][/vc_raw_html][/vc_column][/vc_row][vc_row css=".vc_custom_1445391747947{margin-bottom: 0px !important;}"][vc_column][vc_custom_heading text="Our Team" font_container="tag:h1|text_align:center|color:%23ffffff" use_theme_fonts="yes" css=".vc_custom_1444035068140{margin-bottom: 27px !important;}"][cms_grid col_xs="1" col_sm="2" col_md="4" col_lg="4" source="size:4|order_by:date|post_type:teams" cms_template="cms_grid--layout1.php"][/vc_column][/vc_row]', 'About Us', '', 'inherit', 'closed', 'closed', '', '11-autosave-v1', '', '', '2016-03-04 05:06:27', '2016-03-04 05:06:27', '', 11, 'http://pizza.local/2016/03/04/11-autosave-v1/', 0, 'revision', '', 0),
