/vc_row][vc_row css=".vc_custom_1445391429100{margin-top: 45px !important;margin-bottom: 0px !important;}"][vc_column width="1/3"][cms_fancybox_single title="Fresh Dough" description="Our pizza dough is freshly kneaded and rolled every time an order comes in. We make sure it comes out with just the right thinness to complement our finest toppings." svg_icon="JTNDaW1nJTIwc3JjJTNEJTIyd3AtY29udGVudCUyRnVwbG9hZHMlMkYyMDE2JTJGMDIlMkZjaXJjbGUtaW1nMS5wbmclMjIlMkYlM0U=" cms_template="cms_fancybox_single--layout1.php"][/vc_column][vc_column width="1/3"][cms_fancybox_single title="Hearty Pastas" description="Enjoy the taste of fresh, homemade Italian pasta, without the hours of preparation. We source our ingredients from their ideal origins. " svg_icon="JTNDaW1nJTIwc3JjJTNEJTIyd3AtY29udGVudCUyRnVwbG9hZHMlMkYyMDE2JTJGMDIlMkZjaXJjbGUtaW1nMi5wbmclMjIlMkYlM0U=" cms_template="cms_fancybox_single--layout1.php"][/vc_column][vc_column width="1/3"][cms_fancybox_single title="Finest Ingredients" description="We source and use only the best and freshest ingredients to make sure our pizzas and even our pastas are of top-notch quality. Our dough, pasta, sauces and breads are all homemade as well.\r\n" svg_icon="JTNDaW1nJTIwc3JjJTNEJTIyd3AtY29udGVudCUyRnVwbG9hZHMlMkYyMDE2JTJGMDIlMkZjaXJjbGUtaW1nMy5wbmclMjIlMkYlM0U=" cms_template="cms_fancybox_single--layout1.php"][/vc_column][/vc_row][vc_row][vc_column][vc_wp_text]\r\n<h3>Get a Taste of the Best Italian Pizza in Mactan</h3>\r\nThere’s no need to leave the island to taste authentic Italian pizza. La Bella serves the best pizza in Mactan for everyone to enjoy. Visit us at our resto to discover gastronomic delights in our menu. You can also browse <a href="http://labellapizzamactan.com/shop">our online shop</a> to see what we have in store and place your order.\r\n\r\nIf you’re looking for pizza near Mepz, you don’t have to go too far. We are open to serve you with only the best. As we are conveniently located minutes away from the airport, airport food won’t be much of a problem anymore. Drop by the store or call us for deliveries![/vc_wp_text][/vc_column][/vc_row]', 'Home', '', 'inherit', 'closed', 'closed', '', '996-revision-v1', '', '', '2016-04-19 06:08:49', '2016-04-19 06:08:49', '', 996, 'http://labella.local/2016/04/19/996-revision-v1/', 0, 'revision', '', 0);
